import style from "./types.module.css";
function Button(props) {
  props.setButton(true);
  return (
    <div className={style.buttonContainer}>
      <div
        onClick={() => {
          console.log(props.currentLessonIndex);
          if (props.currentLessonIndex !== props.lessons.length - 1) {
            props.currentLessonIndex++;
            props.setCurrentLessonName(
              props.lessons[props.currentLessonIndex].lessonName
            );
          }
          props.setCurrentPage(0);
          props.setCurrentStep([]);
          props.setFetching(true);
        }}
        className={style.button}
      >
        Continue
      </div>
    </div>
  );
}
export default Button;
